    const products = [
        {name: "2 room Hallway Spec"},
        {name: "Sofa/Love Seat Spec"},
        {name: "2 room min"},
        {name: "Sectional"},
        {name: "Recliner"},
        {name: "Stairs"},
        {name: "Hallway"}
    ]

    return (
        <div>
<Form>
  <Form.Group controlId="exampleForm.SelectCustom">
    <Form.Label>Custom select</Form.Label>
    <Form.Control as="select" custom>
        {products.map(()=>{
            return (
      <option>{products.name}</option>
        )})}
    </Form.Control>
  </Form.Group>
</Form>
</div>
    )
}

export default JobForm;
